 /*==================================
            table of content
            1. window load function
                a. preloader setup
                b. portfolio isotope setup
            2. document ready function
                a. scrollit setup
                b. navbar scrolling background
                c. stats counter setup
                d. navbar close on click mobile responsive
                f. testimonial owlcarousel setup
                g. skills progress bar setup
                h. load more setup
        ==================================*/

        /*========window load function========*/
        $(window).on("load", function () {

            /*========preloader setup========*/
            $('.preloader').fadeout(200);

            /*========portfolio isotope setup========*/
            if ($(".portfolio-section").length) {
                var $elements = $(".portfolio-section");
                $elements.isotope();
                $(".port-filter ul li").on("click", function () {
                    $(".port-filter ul li").removeclass("filter-item");
                    $(this).addclass("filter-item");
                    var selector = $(this).attr("data-filter");
                    $(".portfolio-section").isotope({
                        filter: selector,
                        animationoptions: {
                            duration: 750,
                            easing: "linear",
                            queue: false,
                        },
                    });
                });
            }

        });

        /*========document ready function========*/
        $(function () {

            "use strict";
            var wind = $(window);

            /*========scrollit setup========*/
            $.scrollit({
                upkey: 38, // key code to navigate to the next section
                downkey: 40, // key code to navigate to the previous section
                easing: 'swing', // the easing function for animation
                scrolltime: 600, // how long (in ms) the animation takes
                activeclass: 'active', // class given to the active nav element
                onpagechange: null, // function(pageindex) that is called when page is changed
                topoffset: -15 // offste (in px) for fixed top navigation
            });

            /*========navbar scrolling background========*/
            wind.on("scroll", function () {
                var bodyscroll = wind.scrolltop(),
                    navbar = $(".navbar")
                if (bodyscroll > 300) {
                    navbar.addclass("fixed-top");
                } else {
                    navbar.removeclass("fixed-top");
                }
            });

            /*========stats counter setup========*/
            (function () {
                if ($("section.counter-area").length > 0) {
                    var a = 0;
                    $(window).on('scroll', function () {
                        var otop = $('section.counter-area').offset().top - window.innerheight;
                        if (a == 0 && $(window).scrolltop() > otop) {
                            $('section.counter-area .counter-item .counter').each(function () {
                                var $this = $(this),
                                    countto = $this.attr('data-count');
                                $({
                                    countnum: $this.text()
                                }).animate({
                                    countnum: countto
                                }, {
                                    duration: 2000,
                                    easing: 'swing',
                                    step: function () {
                                        $this.text(math.floor(this.countnum));
                                    },
                                    complete: function () {
                                        $this.text(this.countnum);
                                    }
                                });
                            });
                            a = 1;
                        }
                    });
                }

            })();

            /*========navbar close on click mobile responsive========*/
            $(".nav-item .nav-link").on('click', function () {
                $(".navbar-collapse").removeclass("show");
            });

            /*========testimonial owlcarousel setup========*/
            $("#testimonial-slider").owlcarousel({
                navigation: false,
                pagination: true,
                slidespeed: 800,
                paginationspeed: 800,
                smartspeed: 500,
                autoplay: true,
                singleitem: true,
                dots: true,
                loop: true,
                responsive: {
                    0: {
                        items: 1
                    },
                    767: {
                        items: 1
                    },
                    1000: {
                        items: 1
                    }
                }
            });


            /*========skills progress bar setup========*/
            var wind = $(window);
            wind.on('scroll', function () {
                $(".bar span").each(function () {
                    var bottom_of_object =
                        $(this).offset().top + $(this).outerheight();
                    var bottom_of_window =
                        $(window).scrolltop() + $(window).height();
                    var myval = $(this).attr('data-width');
                    if (bottom_of_window > bottom_of_object) {
                        $(this).css({
                            width: myval
                        });
                    }
                });
            });

            /*========blog pagination setup========*/
            $(".blog .row").append($(".blog-pager")), $(".blog-pager").fadein();

            /*========load more setup========*/
            jquery.ias();

        });
        
        
        
        
